import React from "react";
import Card from "../UI/Card";

const Employee = (props) => {


const alertHandler = () => {

  alert(`Department: ${props.department} 
  employee_id:${props.employ_id}
  employee_age:${props}


  `);


};

  return (
    <Card>
      <p>
        <label onClick={alertHandler}>Name: {props.name}</label>
      </p>
      <p>
        <label>Age: {props.age}</label>
      </p>
      <p>
        <label>Emp_id: {props.employ_id}</label>
      </p>

    </Card>
  );
};
export default Employee;
